import React from "react";
import product from "../../data/product";

export default prop => {

    const lass = product.map(products => {
        return (
            <table>
                <tr><td>{products.id}</td><td>{products.product}</td><td>{products.price}</td></tr>
            </table>

        );
    })

    return (
        <div>
            {lass}
        </div>
    )
}
